import math as m


def funciones():
    print("seleccione la funcion:\n ")
    print("1.Calcular el Seno: ")
    print("2.Calcular el coseno: ")
    print("3.Calculara el tangente: ")
    print("4.Calcular el exponencial: ")
    print("5.Calcular el logaritmo natural: ")

    opc = int(input("Ingrese la fuincion que desea aplicar:\n"))
    num = float(input("ingrese el Valor:\n"))
    if opc == 1:
        sen = m.sin(num)
        print(f" El Seno es {sen}")
    elif opc == 2:
        cos = m.cos(num)
        print(f" El coseno es {cos}")
    elif opc == 3:
        tan = m.tan(num)
        print(f" El Tangente es {tan}")
    elif opc == 4:
        exp = m.exp(num)
        print(f" La expresion es {exp}")
    elif opc == 5:
        log = m.log(num)
        print(f" El logaritmo natural es {log}")

funciones()